class Solution {
    public double meanAbsoluteDeviation(List<Double> numbers) {
        // Calculate the mean of the list
        double mean = numbers.stream().mapToDouble(Double::doubleValue).average().getAsDouble();

        // Calculate the sum of the absolute differences between each element and the mean
        double sum_abs_diff = numbers.stream().map(x -> Math.abs(x - mean)).reduce((a, b) -> a + b).getAsDouble();

        // Return the mean absolute deviation
        return sum_abs_diff / numbers.size();
    }
}

