class Solution {
    public String encrypt(String s) {
        StringBuilder sb = new StringBuilder();
        for (char c : s.toCharArray()) {
            if (Character.isLetter(c)) {
                int pos = c - 'a'; // Get the position of the letter in the alphabet
                pos += 2 * 2; // Rotate the position by 2 times the position
                pos %= 26; // Wrap around to the beginning of the alphabet if necessary
                sb.append((char)('a' + pos)); // Append the rotated letter
            } else {
                sb.append(c);
            }
        }
        return sb.toString();
