class Solution {
    public boolean isSorted(List<Integer> lst) {
        // Check if the list is already sorted
        if (lst.stream().sorted().collect(Collectors.toList()).equals(lst)) {
            return true;
        }

        // Check for duplicates
        Set<Integer> uniqueElements = new HashSet<>();
        for (Integer element : lst) {
            if (!uniqueElements.add(element)) {
                return false;
            }
        }

        // Check if the list is sorted in ascending order
        ListIterator<Integer> iterator = lst.listIterator();
        while (iterator.hasNext()) {
            int currentElement = iterator.next();
            int nextElement = iterator.nextIndex() < lst.size() ? iterator.next() : Integer.MAX_VALUE;
            if (currentElement > nextElement) {
                return false;
            }
        }

        return true;
    }
}

