class Solution {
    public List<Optional<Integer>> largestSmallestIntegers(List<Integer> lst){
        // Find the largest and smallest elements in the list
        int largest = Integer.MIN_VALUE;
        int smallest = Integer.MAX_VALUE;
        for (int i = 0; i < lst.size(); i++) {
            int num = lst.get(i);
            if (num < 0 && num > smallest) {
                smallest = num;
            } else if (num > 0 && num < largest) {
                largest = num;
            }
        }
        // Create a list with the largest and smallest elements
        List<Optional<Integer>> result = new ArrayList<>();
        result.add(Optional.ofNullable(smallest));
        result.add(Optional.ofNullable(largest));
        return result;
    }
}

